import React from 'react';
import { Div, Img } from './signup';

const SignUp = () => {
    return (
        <Div conatiner>
            <Div info>
                <Div img>
                    <Img src={process.env.PUBLIC_URL + '/Img/main-logo.png'} />
                </Div>
            </Div>
        </Div>
    );
};

export default SignUp;
